function verifyCapillarity(){
	log.info("#verifyCapillarity");
	var city = hAPI.getCardValue("nmMunicipio");
	var c1 = DatasetFactory.createConstraint("city", city, city, ConstraintType.MUST);
	var constraints = new Array(c1);
	var dataset = DatasetFactory.getDataset("dsCanaisCapilaridade", null, constraints, null);
	var isOk = "false";
	
	if(dataset && dataset.rowsCount > 0) 
		isOk = dataset.getValue(0, "capilaridadeOk");

	return isOk;
}

function handleCapillarity(action,idSpreadSheet,idItem,idTerritory,idMunicipio){
	log.info("#handleCapillarity");
	var state = hAPI.getCardValue("uf");
	var city = encodeURI(idMunicipio);
	
	//var urlWithParams = "http://172.24.52.10:8048/TrataMunicipio?Item_Planilha=";
	var urlWithParams = "https://wscorp.totvs.com.br/TrataMunicipio?Item_Planilha=";
	
	urlWithParams += '{'+
						'"'+action+'":'+
									'{'+
									 	'"PO0_NRPLAN":"'+idSpreadSheet+'",'+
									 	'"PO0_ITEM":"'+idItem+'",'+
									 	'"PO0_EST":"'+state+'",'+
									 	'"PO0_MUN":"'+city+'",'+
									 	'"PO0_CODTER":"'+idTerritory+'"'+
									 '}'+
					'}';
	
	
	var capReturn = callDatasetRest(urlWithParams);
	
	return capReturn.Status;
}

function callDatasetRest(urlWithParams){
	log.info('#CALLDATSET CAPILARIDADE = '+urlWithParams);
	var c1 = DatasetFactory.createConstraint("url", urlWithParams, urlWithParams, ConstraintType.MUST);
	var constraints = [c1];
    var dataset = DatasetFactory.getDataset("dsGenericRest", null, constraints, null);
    var string = dataset.getValue(0, "response");
    
    return JSON.parse(string);
}

function beforeTaskSave(colleagueId,nextSequenceId,userList){
	var CURRENT_STATE = getValue("WKNumState");
	log.info('@beforeTaskSave  CURRENT_STATE:  '+CURRENT_STATE);
	if(nextSequenceId == Activity.ANALISAR_CNPJ){
		var quantity = 0;
		log.info('@beforeTaskSave nextSequenceId == Activity.ANALISAR_CNPJ');
		if(hAPI.getCardValue("fgCopiaRg") == "sim") quantity++;
		if(hAPI.getCardValue("fgRelatorioFaturamento") == "sim") quantity++;
		if(hAPI.getCardValue("fgEireli") == "sim") quantity++;
		if(hAPI.getCardValue("objetoCanalTotvs") == "sim") quantity++;
		if(hAPI.getCardValue("cartaoCnpj") == "sim") quantity++;
		if(hAPI.getCardValue("contratoSocial") == "sim") quantity++;
		if(hAPI.getCardValue("certidaoNegativa") == "sim") quantity++;
		if(hAPI.getCardValue("carteiraClientes") == "sim") quantity++;
		log.info('@beforeTaskSave Attachments.validate(quantity)');
		Attachments.validate(quantity);  
	}
	else if(nextSequenceId == Activity.INFORMAR_CODIGO_UNIDADE && CURRENT_STATE != Activity.ANALISAR_CONTRATO_ASSINADO) 
	{
		log.info('@beforeTaskSave Attachments.validate(1);');
		Attachments.validate(1);
	}
	else if(nextSequenceId == Activity.FIM_CANCELADO){
		var reason = "";
		
		if(CURRENT_STATE == Activity.ANALISAR_REPROVACAO_CANAIS) reason = "Reprovado pela equipe de Canais!";
		else if(CURRENT_STATE == Activity.ANALISAR_REPROVACAO_FRANQUIA) reason = "Reprovado pela franquia!";
		
		hAPI.setCardValue("dsMotivoReprovacao", reason);
	}


	//// Retirando do BeforeStateENtry

	log.info("@beforeTaskSave CANAISONBOARDS diz: "+CURRENT_STATE);
	if(CURRENT_STATE != Activity.INICIO && CURRENT_STATE != Activity.ZERO)
	{
		log.info("@beforeTaskSave Attachments.updateTotal()");
		try {
			Attachments.updateTotal(); //Utilizado um if por que ocorre erro ao tentar alterar o valor de um campo na abertura da solicitação.

		}
		catch(err) {
			log.info("@beforeTaskSave erro: '" + err + "'");
		}
	} 
	if(CURRENT_STATE == Activity.FIM_CANCELADO){
		log.info("@beforeTaskSave sendMailCancel()");
		sendMailCancel(); 
	}
	
	if(CURRENT_STATE == 65){
		log.info("@beforeTaskSave 65");
		var planilha = hAPI.getCardValue("codPlanilha");
		var item = hAPI.getCardValue("codItem");
		var territorio = hAPI.getCardValue("codTerritorio");
		var municipio = hAPI.getCardValue("codMunicipio");
		
		if(planilha != ""){			
			var cap = handleCapillarity("CONFIRMA",planilha,item,territorio,municipio);
			log.info("#cap: "+cap);
			
			if(cap != "OK"){
				log.info("Não foi possível confirmar a reserva de capilaridade! "+cap);
				throw "Não foi possível confirmar a reserva de capilaridade! "+cap;
			}
		}
	}
	
	/**
	 * Envia e-mail notificando o requisitante informando o motivo da reprovacao/cancelamento.
	 * 
	 * @returns void.
	 */
	function sendMailCancel(){
		log.info("@beforeStateEntry/sendMailCancel diz: Inicio");
		var parameters = new java.util.HashMap();
		var recipients = new java.util.ArrayList();
		var sender = hAPI.getCardValue("cdSolicitante");
		var tenantId = numbersOnly(getValue("WKCompany"));
		
		parameters.put("SERVER_URL", hAPI.getCardValue("dsUrlServidor"));
		parameters.put("TENANT_ID", tenantId);
		parameters.put("RECEIVER", hAPI.getCardValue("nmSolicitante"));
		parameters.put("NR_SOLICITATION", getValue("WKNumProces"));
		parameters.put("DS_REASON", hAPI.getCardValue("dsMotivoReprovacao"));
		parameters.put("subject", "Fluxo Onboard");
		
		recipients.add(hAPI.getCardValue("cdSolicitante"));
		
		notifier.notify(sender, "tplCustomCanaisOnboardReprovacao", parameters, recipients, "text/html");
	}

	function numbersOnly(string){
		return java.lang.String.valueOf(string).replaceAll(/\./, "");
	}
}

function afterCancelProcess(colleagueId,processId){
	log.info("##afterCancelProcess");
	
	var planilha = hAPI.getCardValue("codPlanilha");
	var item = hAPI.getCardValue("codItem");
	var territorio = hAPI.getCardValue("codTerritorio");
	var municipio = hAPI.getCardValue("codMunicipio");
	
	if(planilha != ""){
		var cap = handleCapillarity("CANCELA",planilha,item,territorio,municipio);
		log.info("Retorno do cancelamento de reserva: "+cap);
	}
}

function servicetask32(attempt, message) {
	log.info("##SERVIÇO DE CAPILARIDADE");
	var cap = verifyCapillarity();
	
	log.info("#cap: "+cap);
	if(cap != "false" && cap != false){
		hAPI.setCardValue("capilaridadeOk","true");
		
		var jsonCap = JSON.parse(cap);
		
		hAPI.setCardValue("codPlanilha",jsonCap["Planilha"]);
		hAPI.setCardValue("codItem",jsonCap["Item"]);
		hAPI.setCardValue("codTerritorio",jsonCap["Territorio"]);
		hAPI.setCardValue("codMunicipio",jsonCap["Municipio"]);
		
		var returnCap =handleCapillarity("RESERVA",jsonCap["Planilha"],jsonCap["Item"],jsonCap["Territorio"],jsonCap["Municipio"]);
		
		log.info("#returnCap: "+returnCap);
		if(returnCap != "OK"){
			log.info("Ocorreu um erro na reserva de capilaridade! "+returnCap);
			throw "Ocorreu um erro na reserva de capilaridade! "+returnCap;
		}
	}else{
		log.info("Municipio informado nao existe no cadastro de capilaridade");
		throw "Municipio informado nao existe no cadastro de capilaridade";
	}
}

function servicetask85(attempt, message){
	CustomServiceTask85.sendMail();
}

var CustomServiceTask85 = {
	sendMail: function(){
		var parameters = new java.util.HashMap();
		var recipients = new java.util.ArrayList();
		var sender = hAPI.getCardValue("cdSolicitante");
		var tenantId = this.numbersOnly(getValue("WKCompany"));
		var mailTemplate = (hAPI.getCardValue("pvfMasterCat") == "sim") ? "tplCustomCanaisOnboardContratoInterno" : "tplCustomCanaisOnboardContrato";
		
		parameters.put("SERVER_URL", hAPI.getCardValue("dsUrlServidor"));
		parameters.put("TENANT_ID", tenantId);
		parameters.put("RECEIVER", hAPI.getCardValue("nome"));
		parameters.put("NR_SOLICITATION", hAPI.getCardValue("nrSolicitacao"));
		parameters.put("TOKEN", hAPI.getCardValue("token"));
		parameters.put("subject", "Fluxo Onboard");
		
		recipients.add(hAPI.getCardValue("email"));
		log.info('@canaisOnboard.servicetask85  CustomServiceTask85 start notify');
		notifier.notify(sender, mailTemplate, parameters, recipients, "text/html");
		log.info('@canaisOnboard.servicetask85  CustomServiceTask85 end notify');
	},
	numbersOnly: function(string){
		return java.lang.String.valueOf(string).replaceAll(/\./, "");	
	}
};

